import React from 'react';
import { useState, useEffect } from 'react';
import "./css/profile.css"
import {getCurrentUser} from "../services/auth.service";
import {getTourist, getTourist2, printTourist} from "../services/tourist.service";

const Profile: React.FC = () => {
    const currentUser = getCurrentUser();
    // const touristList = getTourist();
    // const list = getTourist2();
    // const test = printTourist();

    const [touristList, setTouristList] = useState({});

    useEffect(() => {
        getTourist2().then((value) => {
            console.log(value);
            setTouristList(value);
        })
    }, []);

    return (
        <div>
            <header>
                <h3>
                    <strong>{currentUser.Name}</strong> Profile
                </h3>
            </header>
            <p>
                <strong>Name: </strong> {currentUser.Name}
                <br/>
                <strong>Email: </strong> {currentUser.Email}
                <p>{touristList}</p>
                {/* {console.log(touristList)} */}
                {/* {console.log(test)} */}
            </p>
        </div>
    );
}; export default Profile;
